937667703181445";}i:118;a:1:{s:10:"short_code";s:11:"CEuUSQbjJCF";}i:119;a:1:{s:12:"created_time";i:1599242002;}i:120;a:1:{s:7:"caption";s:1296:"È sicuramente scontato affermare che redigere un curriculm vitae coerente e ben fatto abbia un’importanza fondamentale per la vita professionale di ciascuno. 
Da anni, oramai, porto avanti, fieramente, la mia battaglia del “NO” al formato Europass in quanto causa di omologazione di ciascun professionista e offuscamento delle potenzialità interiori a scapito dei meri titoli di studio.
Ma quanti sono a conoscenza dei parametri che fanno la differenza tra un curriculum ben fatto ed uno perfetto? 
Questi sono alcuni dei punti fondamentali da prendere sempre in considerazione:
•	Dire sempre la verità, nient’ altro che la verità! 
•	Utilizzare parole chiave interessanti agli occhi dei recruiter
•	Far emergere la tua personalità 
Come si può notare è un qualcosa che richiede tempo oltre che estremo impegno.
Attraverso il mio servizio di career coach ti aiuterò ad elaborare un vero e proprio biglietto da visita che possa distinguerti dalla massa e in cui faremo emergere le tue abilità, conoscenze, i risultati raggiunti negli studi e nel lavoro, gli hobby e le lingue.

